import React, { Component } from 'react';
import "./GeneralSorting.css";

class GeneralSorting extends Component {
    render() {
        return (
            <table>
                <tbody>
                <tr>
                    <td className="my-bold">{this.props.name}</td>
                    <td>BBB</td>
                </tr>
                <tr>
                    <td>CCC</td>
                    <td>DDD</td>
                </tr>
                </tbody>
            </table>
        );
    }
}

export default GeneralSorting;
